contracts/VoterRegistry.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/access/AccessControl.sol";

/// @title VoterRegistry
/// @notice Manage voter registrations and roles for SecureVote.
contract VoterRegistry is AccessControl {
    bytes32 public constant ADMIN_ROLE = DEFAULT_ADMIN_ROLE;

    mapping(address => bool) private _registered;

    event VoterRegistered(address indexed voter);
    event VoterDeregistered(address indexed voter);

    constructor(address admin) {
        _grantRole(ADMIN_ROLE, admin);
    }

    modifier onlyAdmin() {
        require(hasRole(ADMIN_ROLE, msg.sender), "VoterRegistry: Restricted to admins");
        _;
    }

    /// @notice Register a voter (admin only)
    function registerVoter(address voter) external onlyAdmin {
        require(voter != address(0), "VoterRegistry: zero address");
        require(!_registered[voter], "VoterRegistry: already registered");
        _registered[voter] = true;
        emit VoterRegistered(voter);
    }

    /// @notice Deregister a voter (admin only)
    function deregisterVoter(address voter) external onlyAdmin {
        require(_registered[voter], "VoterRegistry: not registered");
        _registered[voter] = false;
        emit VoterDeregistered(voter);
    }

    /// @notice Check if an address is registered as voter
    function isRegistered(address voter) external view returns (bool) {
        return _registered[voter];
    }
}

contracts/Voting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Voting {
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    struct Election {
        uint id;
        string title;
        string description;
        uint startTime;
        uint endTime;
        bool active;
        address admin;
        mapping(uint => Candidate) candidates;
        uint candidateCount;
        mapping(address => bool) hasVoted;
    }

    mapping(uint => Election) public elections;
    uint public electionCount;

    event ElectionCreated(uint indexed electionId, string title);
    event VoteCasted(uint indexed electionId, uint candidateId, address voter);

    modifier onlyAdmin(uint _electionId) {
        require(msg.sender == elections[_electionId].admin, "Not admin");
        _;
    }

    modifier validElection(uint _electionId) {
        require(_electionId > 0 && _electionId <= electionCount, "Invalid election");
        _;
    }

    // ✅ Create a new election
    function createElection(
        string memory _title,
        string memory _description,
        uint _startTime,
        uint _endTime
    ) public {
        require(_startTime < _endTime, "Invalid time range");
        electionCount++;
        Election storage e = elections[electionCount];
        e.id = electionCount;
        e.title = _title;
        e.description = _description;
        e.startTime = _startTime;
        e.endTime = _endTime;
        e.active = true;
        e.admin = msg.sender;

        emit ElectionCreated(electionCount, _title);
    }

    // ✅ Add a candidate (only admin)
    function addCandidate(uint _electionId, string memory _name)
        public
        onlyAdmin(_electionId)
        validElection(_electionId)
    {
        Election storage e = elections[_electionId];
        e.candidateCount++;
        e.candidates[e.candidateCount] = Candidate(e.candidateCount, _name, 0);
    }

    // ✅ Vote (only once per address)
    function vote(uint _electionId, uint _candidateId)
        public
        validElection(_electionId)
    {
        Election storage e = elections[_electionId];
        require(block.timestamp >= e.startTime && block.timestamp <= e.endTime, "Voting not active");
        require(!e.hasVoted[msg.sender], "Already voted");
        require(_candidateId > 0 && _candidateId <= e.candidateCount, "Invalid candidate");

        e.hasVoted[msg.sender] = true;
        e.candidates[_candidateId].voteCount++;

        emit VoteCasted(_electionId, _candidateId, msg.sender);
    }

    // ✅ Get candidate info
    function getCandidate(uint _electionId, uint _candidateId)
        public
        view
        returns (string memory name, uint voteCount)
    {
        Election storage e = elections[_electionId];
        Candidate storage c = e.candidates[_candidateId];
        return (c.name, c.voteCount);
    }

    // ✅ End election
    function endElection(uint _electionId) public onlyAdmin(_electionId) {
        elections[_electionId].active = false;
    }
}

contracts/VotingSystem.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

contract VotingSystem {
    struct Candidate {
        uint id;
        string name;
        uint voteCount;
    }

    struct Election {
        uint id;
        string name;
        bool isActive;
        uint startTime;
        uint endTime;
        mapping(uint => Candidate) candidates;
        uint candidatesCount;
        mapping(address => bool) hasVoted;
    }

    address public admin;
    uint public electionsCount;
    mapping(uint => Election) public elections;

    event ElectionCreated(uint electionId, string name);
    event CandidateAdded(uint electionId, string candidateName);
    event VoteCasted(uint electionId, uint candidateId);

    constructor() {
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    function createElection(string memory _name, uint _startTime, uint _endTime) public onlyAdmin {
        require(_endTime > _startTime, "Invalid time period");

        electionsCount++;
        Election storage newElection = elections[electionsCount];
        newElection.id = electionsCount;
        newElection.name = _name;
        newElection.isActive = false;
        newElection.startTime = _startTime;
        newElection.endTime = _endTime;

        emit ElectionCreated(electionsCount, _name);
    }

    function addCandidate(uint _electionId, string memory _name) public onlyAdmin {
        Election storage election = elections[_electionId];
        election.candidatesCount++;
        election.candidates[election.candidatesCount] = Candidate(election.candidatesCount, _name, 0);

        emit CandidateAdded(_electionId, _name);
    }
}

